••••••
The “Pulse on the Nation’s #nurses” survey has found that 3 out of 4 #nurses responding to #COVID19 report difficulty sleeping. I feel this will surprise none of us in the #nursing profession, but it does mean that the data supports what any of us could tell the researchers.
••••••
But what does it mean that nurses are having problems sleeping? #nursetired is known as #nursefatigue in the literature 😴 & has been researched for a while. A great concern is - what kind of #patientcare do sleepy nurses provide? 
••••••
The American Academy of Nurses actually published a position statement on #nursefatigue called “Position statement: Reducing fatigue associated with sleep deficiency and work hours in nurses“ where it states - “The American Academy of Nursing recognizes that safe nursing practice requires health care providers obtaining sleep that is of high quality and adequate duration. Nurse fatigue poses a danger to patients because of increased risk of error, other people on the roads when tired nurses commute to and from work, and the health and safety of nurses themselves.” 
••••••
This position statement goes on to recommend the following - 😴 Urge nurses & employers of health care orgs to educate themselves about the health risks linked to shift work & long work hours & the EB strategies to reduce those risks. 😴Urge employers of health care orgs to incorporate EBP in the design of their employees' work schedules & establish policies, practices, & systems at work that promote sleep health & an alert workforce. 😴 Urge employers to promote a workplace culture that promotes sleep #health to achieve optimum functioning, health, #safety, & sense of #wellbeing of their workforce. 😴Encourage employers to recognize the role of shift work, long shifts, & nurse fatigue on turnover, absenteeism, patient safety, & related costs. 😴 Urge experts to develop CE courses that relay EBP personal & workplace interventions to maximize sleep health & alertness in nurses.
••••••
