and it's vegan btw

𝒊𝒏𝒈𝒓𝒆𝒅𝒊𝒆𝒏𝒕𝒔:
1 can of chickpeas
2 tbsp peanut butter
2 tbsp maple sirup
2 tbsp plant milk 
2 tbsp oat flour 
chocolate chips or nuts

𝒓𝒆𝒄𝒊𝒑𝒆:
blend all the ingredients excluding the oat flour in a food processor or blender and sweeten to taste.
mix in the oat flour and add until preferred consisteny.
lastly, add-ins of your choice! I went with chocolate chunks and chopped pecans ♡︎ 
